package com.kurgan.kursach.models;import lombok.AllArgsConstructor;import lombok.Getter;import lombok.NoArgsConstructor;import lombok.Setter;import javax.persistence.*;import java.util.Set;@Table@Entity(name = "roles")@Getter@Setter@NoArgsConstructor@AllArgsConstructorpublic class Role {    @Id    @GeneratedValue(strategy = GenerationType.IDENTITY)    private Long id;    private String name;    @ManyToMany(mappedBy = "roles")    private Set<User> users;}